--Keybind:
local BFkeybinds = {
	ToggleKeybind = 'RightAlt'
}
local ui0 = game.CoreGui.BloxFunGui
function toggleUi()
	ui0.Enabled = not ui0.Enabled
end

game:GetService('UserInputService').InputBegan:Connect(function(input,ok0)
	if not ok0 then
		if input.KeyCode.Name == BFkeybinds.ToggleKeybind then
			toggleUi()
			if game.CoreGui.BloxFunGui.Enabled == true then
			    game:GetService("UserInputService").MouseBehavior = Enum.MouseBehavior.Default
			elseif game.CoreGui.BloxFunGui.Enabled == false then
			    game:GetService("UserInputService").MouseBehavior = Enum.MouseBehavior.LockCenter
			end
		end
	end
end)
